
(function() {
	var icons = {
		firefox: "data:image/svg+xml;base64,",
		chrome: "data:image/svg+xml;base64,",
		edge: "data:image/svg+xml;base64,",
		safari: "data:image/svg+xml;base64,"
	}

	function detectLegacy() {
		try {
			eval("const foo=x=>x+1")
			return false
		}
		catch (error) {
			return true
		}
	}

	function createSorryPopup() {
		var popup = document.createElement("div")
		popup.className = "sorry-popup"
		popup.innerHTML = ''
			+ '<div class="sorry-plate">'
			+ '  <h1>Sorry!</h1>'
			+ '  <p>Your web browser is not supported</p>'
			+ '  <p>Please consider using a modern browser instead</p>'
			+ '  <div class="sorry-list">'
			+ '    <a href="https://www.mozilla.org/firefox/new/" target="_blank">'
			+ '      <img src="' + icons.firefox + '" alt=""/>'
			+ '      <p>Firefox</p>'
			+ '    </a>'
			+ '    <a href="https://www.google.com/chrome/" target="_blank">'
			+ '      <img src="' + icons.chrome + '" alt=""/>'
			+ '      <p>Chrome</p>'
			+ '    </a>'
			+ '    <a href="https://www.microsoft.com/windows/microsoft-edge" target="_blank">'
			+ '      <img src="' + icons.edge + '" alt=""/>'
			+ '      <p>Edge</p>'
			+ '    </a>'
			+ '    <a href="https://www.apple.com/safari/" target="_blank">'
			+ '      <img src="' + icons.safari + '" alt=""/>'
			+ '      <p>Safari</p>'
			+ '    </a>'
			+ '  </div>'
			+ '  <p class="close"><a href="#">close</a></p>'
			+ '</div>'
		popup.querySelector(".close > a").onclick = function() {
			document.body.removeChild(popup)
		}
		var style = document.createElement("style")
		style.textContent = ''
			+ '.sorry-popup {'
			+ '  z-index: 9999;'
			+ '  position: absolute;'
			+ '  font-size: 21px;'
			+ '  top: 0;'
			+ '  left: 0;'
			+ '  width: 100%;'
			+ '  height: 100%;'
			+ '  text-align: left;'
			+ '  font-family: sans-serif;'
			+ '  color: #444;'
			+ '  background: rgba(64,64,64, 0.8);'
			+ '}'
			+ '.sorry-popup .sorry-plate {'
			+ '  z-index: 9999;'
			+ '  position: absolute;'
			+ '  top: 5%;'
			+ '  left: 10%;'
			+ '  right: 10%;'
			+ '  padding: 2% 5%;'
			+ '  background: #eee;'
			+ '  max-width: 800px;'
			+ '  margin: auto;'
			+ '}'
			+ '.sorry-popup h1 {'
			+ '  '
			+ '}'
			+ '.sorry-popup p {'
			+ '  margin: 0.6em auto;'
			+ '}'
			+ '.sorry-popup .sorry-list {'
			+ '  display: table;'
			+ '  width: 100%;'
			+ '  margin-top: 2em;'
			+ '}'
			+ '.sorry-popup a {'
			+ '  color: #3855ca;'
			+ '  text-decoration: none;'
			+ '}'
			+ '.sorry-popup a:hover,'
			+ '.sorry-popup a:focus {'
			+ '  text-decoration: underline;'
			+ '}'
			+ '.sorry-popup .sorry-list > a {'
			+ '  display: table-cell;'
			+ '  max-width: 0;'
			+ '  text-align: center;'
			+ '  font-weight: bold;'
			+ '  padding: 0.6em 0;'
			+ '  border-radius: 8px;'
			+ '}'
			+ '.sorry-popup .sorry-list > a:hover,'
			+ '.sorry-popup .sorry-list > a:focus {'
			+ '  background: white;'
			+ '}'
			+ '.sorry-popup .sorry-list > a > img {'
			+ '  display: block;'
			+ '  width: 80%;'
			+ '  margin: auto;'
			+ '}'
			+ '.sorry-popup .sorry-list > a > p {'
			+ '  margin-top: 0.6em;'
			+ '}'
			+ '.sorry-popup .close {'
			+ '  opacity: 0.7;'
			+ '  font-size: 0.8em;'
			+ '  margin-top: 1.5em;'
			+ '  text-align: center;'
			+ '}'
		popup.appendChild(style)
		return popup
	}

	// detect legacy browsers
	var legacy = detectLegacy()

	// if "sorry-force-legacy" is in the hash, force legacy
	if (/^#?sorry-force-legacy/i.test(window.location.hash))
		legacy = true

	// on legacy systems, create and insert the sorry popup
	if (legacy) {
		var popup = createSorryPopup()
		document.body.insertBefore(popup, document.body.firstChild)
	}
})()
